import {BrowserRouter, Routes, Route} from "react-router-dom";
import Nav from "./Components/Nav/Nav";
import Hero from './Components/Hero/Hero';

function App() {
  return (
    <BrowserRouter>
      <Nav/>
      <Routes>
        <Route path="/" element={<LandingPage/>}/>
      </Routes>
      <Hero/>
    </BrowserRouter>

  );
}

export default App;
